import numpy as np
import matplotlib.pyplot as plt

# Discretization parameters
N = 10
h = 1/N

# Grid creation
x = np.arange(0, 1.0001, h)
y = np.arange(0, 1.0001, h)
X, Y = np.meshgrid(x, y)

# Boundary values
w = np.zeros((N+1, N+1))
for i in range(N):
    w[i, 0] = np.sin(2*np.pi*x[i])     # Left Boundary
    w[i, N] = np.sin(2*np.pi*x[i])     # Right Boundary
for j in range(N):
    w[0, j] = 2*np.sin(2*np.pi*y[j])   # Lower Boundary
    w[N, j] = 2*np.sin(2*np.pi*y[j])   # Upper Boundary

# Matrix A and its inverse
N2 = (N-1)*(N-1)
A = np.zeros((N2, N2))
for i in range(N-1):
    for j in range(N-1):
        A[i + (N-1)*j, i + (N-1)*j] = -4
        if i > 0: A[i + (N-1)*j, i + (N-1)*j-1] = 1
        if i < N-2: A[i + (N-1)*j, i + (N-1)*j+1] = 1
        if j > 0: A[i + (N-1)*j, i + (N-1)*(j-1)] = 1
        if j < N-2: A[i + (N-1)*j, i + (N-1)*(j+1)] = 1
Ainv = np.linalg.inv(A)

# Right-hand side vector
r = np.zeros(N2)
for i in range(N-1):
    for j in range(N-1):
        r[i + (N-1)*j] = 100 * h**2 * (x[i+1]**2 + y[j+1]**2)

# Boundary vector
# These separate boundary vectors are used for efficient matrix operations and calculations,
# ensuring the boundary conditions are correctly incorporated into the solution.
b_bottom_top = np.zeros(N2)
for i in range(N-1):
    b_bottom_top[i] = np.sin(2*np.pi*x[i+1])          # Bottom Boundary
    b_bottom_top[i + (N-1)*(N-2)] = np.sin(2*np.pi*x[i+1])  # Top Boundary
b_left_right = np.zeros(N2)
for j in range(N-1):
    b_left_right[(N-1)*j] = 2*np.sin(2*np.pi*y[j+1])   # Left Boundary
    b_left_right[N-2 + (N-1)*j] = 2*np.sin(2*np.pi*y[j+1])  # Right Boundary
b = b_left_right + b_bottom_top

# Solve the system
C = np.dot(Ainv, r-b)
w[1:N, 1:N] = C.reshape((N-1, N-1))

# Visualization
fig = plt.figure(figsize=(8,6))
ax = fig.add_subplot(111, projection='3d')
ax.plot_wireframe(X, Y, w, color='b')
ax.set_xlabel('x')
ax.set_ylabel('y')
ax.set_zlabel('w')
plt.title(r'Numerical Approximation of the Poisson Equation', fontsize=24, y=1.08)
plt.show()

